function initMain(envName) {
	EnvName = !envName ? WindowsEnv : envName;

	if (isPlainHtmlConverter()) {
		initPlainHtmlConverter();
		log('Main Initialized.(Converter)');
		return;
	}

	initClipboard();

	initWindow();

	initInput();

	initDrop();
	initDrag();

	initEditor();

	IsLoaded = true;
	if (isAppendNotifier()) {
		log('Main Initialized.(Appender)');
		enableSubSelection();
	} else {
		log('Main Initialized.(Content)');
	}	

	onInitComplete_ntf();
}
